import { HttpClient } from '@angular/common/http';
import { Component, OnInit } from '@angular/core';
import { FormBuilder } from '@angular/forms';
import { Router } from "@angular/router";


@Component({
  selector: 'admin-panel',
  templateUrl: './admin-panel.html',
  styleUrls: ['./admin-panel.css']
})
export class AdminPanelComponent implements OnInit {

  public static Url: string = 'https://localhost:7080/User/';

  constructor(private http: HttpClient, private router: Router, private categoryName: string) {
   
  }

  ngOnInit() {
    this.http.post<any>('https://localhost:7080/Category', { title: 'Category' }).subscribe(data => {
      this.categoryName = data.id;
    })


    var session = sessionStorage.getItem('logged');
    if (session != 'true') {
      alert("You need to Log in to use this page!");
      this.router.navigate(['/login-page']);
    }
  }


}
